import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Table } from 'react-bootstrap'; // Import React Bootstrap Table component if you're using Bootstrap 4 or above


const UserAddressComponent = () => {
  const [userAddresses, setUserAddresses] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:9856/api/user-address')
      .then(response => {
        setUserAddresses(response.data);
      })
      .catch(error => {
        console.error('Error fetching user addresses:', error);
      });
  }, []);

  return (
    <div>
      <h2>User Address Details</h2>
      <Table striped bordered hover > {/* Use Bootstrap Table component */}
        <thead>
          <tr>
            <th>ID</th>
            <th>Full Name Prefix</th>
            <th>Full Name</th>
            <th>PAN Card</th>
            {/* Add more headers as needed */}
          </tr>
        </thead>
        <tbody>
          {userAddresses.map(address => (
            <tr key={address.id}>
              <td>{address.id}</td>
              <td>{address.fullNamePrefix}</td>
              <td>{address.fullName}</td>
              <td>{address.panCard}</td>
              {/* Add more cells as needed */}
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default UserAddressComponent;
